import React from 'react'
import s from './Dialogs.module.css'
import {NavLink} from "react-router-dom";

const NameDialog = (props) => {
    return (
        <div className={s.dialog + ' ' + s.active}>
            <NavLink className={navData => navData.isActive ? s.active : s.dialog}
                     to={'/dialogs/' + props.id}> {props.name}</NavLink>
        </div>
    )
}
const Message = (props) => {
    return (
        <div className={s.message_item}>{props.text}</div>
    )
}
const Dialogs = () => {
    const DialogData = [
        {id:1,name:'Mikee'},
        {id:2,name:'Denis'},
        {id:3,name:'Mikee'},
        {id:4,name:'Mikee'},
        {id:5,name:'Mikee'}
    ]
    return (
        <div className={s.container}>
            <div className={s.dialogs}>
                <div className={s.dialog_items}>
                    <NameDialog name='Mikee' id='1'/>
                    <NameDialog name='Denis' id='2'/>
                    <NameDialog name='Alex' id='3'/>
                    <NameDialog name='Roma' id='4'/>
                    <NameDialog name='Ylia' id='5'/>

                </div>
            </div>
            <div className={s.messages}>
                <Message text='Hi its message'/>
                <Message text='dont?'/>
                <Message text='i have casca'/>
                <Message text='have are you'/>
                <Message text='i love you'/>

            </div>
        </div>
    )
}
export default Dialogs
